UPDATE etfs_ativos_reais 
    SET dividends_12m = CASE symbol
        WHEN 'QQQD' THEN 0.8879999999999999 WHEN 'VT' THEN 2.274 WHEN 'RYE' THEN 1.98876 WHEN 'MORT' THEN 1.3050000000000002 WHEN 'URE' THEN 1.284 WHEN 'YBIT' THEN 2.048 WHEN 'TIPZ' THEN 1.02 WHEN 'EWQ' THEN 2.393 WHEN 'PFI' THEN 1.194 WHEN 'QQQG' THEN 0.027 WHEN 'XVV' THEN 0.494 WHEN 'VLLU' THEN 0.184 WHEN 'ROM' THEN 0.255 WHEN 'SYNB' THEN 0.235 WHEN 'EMIF' THEN 1.347 WHEN 'EWJV' THEN 2.2350000000000003 WHEN 'SPAM' THEN 0.038 WHEN 'DBC' THEN 2.604 WHEN 'DTH' THEN 1.922 WHEN 'MKOR' THEN 1.097
    END,
    updatedat = NOW()
    WHERE symbol IN ('QQQD', 'VT', 'RYE', 'MORT', 'URE', 'YBIT', 'TIPZ', 'EWQ', 'PFI', 'QQQG', 'XVV', 'VLLU', 'ROM', 'SYNB', 'EMIF', 'EWJV', 'SPAM', 'DBC', 'DTH', 'MKOR');